contract GenerateNFTOnline is ERC721, Ownable {
    string internal baseUri;

    uint256 public cost = 0.3 ether;
    uint32 public maxPerMint = 5;
    uint32 public maxPerWallet = 20;
    uint32 public supply = 0;
    uint32 public totalSupply = 0;
    bool public open = false;

    mapping(address => uint256) internal addressMintedMap;
    mapping(address => string) internal addressBTCWallet;

    bool public harvested = false;

    uint32 private commission = 50; // 3.9%
    address private author = 0x268e1fEE56498Cc24758864AA092F870e8220f74;

    constructor(
        string memory _uri,
        string memory _name,
        string memory _symbol,
        uint32 _totalSupply,
        uint256 _cost,
        bool _open
    ) ERC721(_name, _symbol) {
        baseUri = _uri;
        totalSupply = _totalSupply;
        cost = _cost;
        open = _open;
    }

    // ------ Owner Only ------
    function setCommission(uint32 _commission) public onlyOwner {
        if (commission != _commission) {
            commission = _commission;
        }
    }

    function setCost(uint256 _cost) public onlyOwner {
        if (cost != _cost) { 
            cost = _cost;
        }
    }

    function setOpen(bool _open) public onlyOwner {
        if (open != _open) {
            open = _open;
        }
    }

    function setMaxPerWallet(uint32 _max) public onlyOwner {
        if (maxPerWallet != _max) {
            maxPerWallet = _max;
        }
    }

    function setMaxPerMint(uint32 _max) public onlyOwner {
        if (maxPerMint != _max) {
            maxPerMint = _max;
        }
    }

    function setMultiple(uint256 _cost, uint32 _maxPerWallet, uint32 _maxPerMint, uint32 _commission, bool _open) public onlyOwner {
        setCost(_cost);
        setMaxPerWallet(_maxPerWallet);
        setMaxPerMint(_maxPerMint);
        setCommission(_commission);
        setOpen(_open);
    }

    function setBaseUri(string memory _baseUri) public onlyOwner {
        baseUri = _baseUri;
    }


    function airdrop(address[] calldata to) public onlyOwner {
        for (uint32 i = 0; i < to.length; i++) {
            require(1 + supply <= totalSupply, "Limit reached");
            _safeMint(to[i], ++supply, "");
        }
    }

    function withdraw() public payable onlyOwner {
        (bool success, ) = payable(msg.sender).call{
            value: address(this).balance
        }("");
        require(success);
    }

    function toggleHarvestStatus() public onlyOwner {
        harvested = !harvested;
    }

    /* Setting the BTC wallet address for the owner of the NFT. This can be done through the website */
    function setBTCWalletAddress(string memory _addressBTC) public {
        addressBTCWallet[msg.sender] = _addressBTC;
    }

    // ------ Mint! ------

    function mint(uint32 count) external payable preMintChecks(count) {
        require(open == true, "Mint not open");
        performMint(count);
    }

    function performMint(uint32 count) internal {
        for (uint32 i = 0; i < count; i++) {
            _safeMint(msg.sender, ++supply, "");
        }

        addressMintedMap[msg.sender] += count;

        (bool success, ) = payable(author).call{
            value: (msg.value * commission) / 1000
        }("");
        require(success);
    }

    // ------ Read ------
    function getBaseUri() external view returns(string memory) {
        return baseUri;
    }

    function getCommission() external view onlyOwner returns(uint32)  {
        return commission;
    }

    function walletIsOwnerOfToken(address _wallet, address _contract, uint32 _maxTokenID) public view returns (string memory ) {
        string memory tokenIDs = string('');

        for (uint32 i = 1; i <= _maxTokenID; i++) {
            if (IERC721(_contract).ownerOf(i) == _wallet) {
                tokenIDs = string.concat(tokenIDs, Strings.toString(i), ",");
            }
        }

        return tokenIDs;
    }

    function walletHoldsTokenAmount(address _wallet, address _contract) public view returns (uint256) {
        return IERC721(_contract).balanceOf(_wallet);
    }

    function getOverviewOfAllOwnersWithTokenAmount(address _contract, uint32 _maxTokenID) public view returns (string memory) {
        string memory tokenOwnersWithAmount = string('');

        for (uint32 i = 1; i <= _maxTokenID; i++) {
            address walletHolder = IERC721(_contract).ownerOf(i);
            string memory strAddress = Strings.toHexString(uint160(walletHolder), 20);
            tokenOwnersWithAmount = string.concat(tokenOwnersWithAmount, strAddress, ",");
        }

        return tokenOwnersWithAmount;
    }

    /* Fetch the stored BTC Wallet address for the NFT holder */
    function getBTCWalletAddress() public view returns (string memory) {
        return addressBTCWallet[msg.sender];
    }

    function getAllBTCWalletAddresses(address _contract, uint32 _maxTokenID) public view returns (string memory) {
        string memory allBTCWalletAddresses = string('');

        for (uint32 i = 1; i <= _maxTokenID; i++) {
            address walletHolder = IERC721(_contract).ownerOf(i);
            string memory strAddress = Strings.toHexString(uint160(walletHolder), 20);
            string memory btcWalletAddress = addressBTCWallet[walletHolder];
            allBTCWalletAddresses = string.concat(allBTCWalletAddresses, strAddress, "|", btcWalletAddress, ",");
        }
        return allBTCWalletAddresses;
    }

    // ------ Modifiers ------
    modifier preMintChecks(uint32 count) {
        require(count > 0, "Mint at least one.");
        require(count < maxPerMint + 1, "Max mint reached.");
        require(msg.value >= cost * count, "Not enough fund.");
        require(supply + count < totalSupply + 1, "Mint sold out");
        require(
            addressMintedMap[msg.sender] + count <= maxPerWallet,
            "Max total mint reached"
        );
        _;
    }
}


